import React from "react";
import { getAll } from "../BooksAPI";
// import { get } from "../BooksAPI";
// import axios from 'axios'
function GetAllBooks() {
  getAll().then((res) =>
    console.log(res.map((x) => [x.id, x.description, x.imageLinks]))
  );
  return <div></div>;
}

export default GetAllBooks;
